import React, { Component } from 'react'

export default class Detail extends Component {

    render() {
        const contentArr = [
            {id:'01',content:'hello, i'}
        ]
        const { title, id } = this.props.match.params;
        return (
            <ul>
                <li>id:{id}</li>
                <li>title:{title}</li>
                <li>Content:hhh</li>
            </ul>
        )
    }
}
